Jeder Schnittstellenname muss mit I beginnen, der Antworttyp generiert nur data, keine Felder wie code, msg usw.

```ts
import request from "@/utils/request";
/** Schnittstellenbeschreibung - Parameter */
export interface IApiDescParams {
  /** Anzahl der Seiten */
  pageSize: number;
}
/** Schnittstellenbeschreibung - Antwort */
export interface IApiDescData {}
/** Schnittstellenbeschreibung - Schnittstelle */
export const methodApiDescApi = (params: IApiDescParams) => {
  return request.get<IApiDescData>("/xxx", params);
};
```
